import{_ as t,o as a,c as n,ag as i}from"./chunks/framework.D4MlTk4Q.js";const g=JSON.parse('{"title":"Installer Analyzer","description":"","frontmatter":{},"headers":[],"relativePath":"views/analyzer.md","filePath":"views/analyzer.md","lastUpdated":1770603064000}'),o={name:"views/analyzer.md"};function r(s,e,l,d,u,c){return a(),n("div",null,[...e[0]||(e[0]=[i('<h1 id="installer-analyzer" tabindex="-1">Installer Analyzer <a class="header-anchor" href="#installer-analyzer" aria-label="Permalink to &quot;Installer Analyzer&quot;">​</a></h1><p>The <strong>Installer Analyzer</strong> is a core component of SwitchCraft designed to inspect installer files (<code>.exe</code>, <code>.msi</code>, <code>.msp</code>) and determine the correct silent installation parameters automatically.</p><h2 id="purpose" tabindex="-1">Purpose <a class="header-anchor" href="#purpose" aria-label="Permalink to &quot;Purpose&quot;">​</a></h2><p>Packaging applications for enterprise deployment (Intune, SCCM) requires knowing how to install software silently (without user interaction). The Analyzer automates the discovery of these &quot;switches&quot; using a combination of:</p><ul><li><strong>Signature Matching</strong>: Detecting known installer frameworks (Inno Setup, NSIS, InstallShield, WiX, etc.).</li><li><strong>Brute Force Analysis</strong>: Attempting common patterns if signatures fail.</li><li><strong>Universal Extraction</strong>: Inspecting internal file structures.</li><li><strong>Community Database</strong>: Checking a hash-based cloud database for known switches.</li></ul><h2 id="interface-overview" tabindex="-1">Interface Overview <a class="header-anchor" href="#interface-overview" aria-label="Permalink to &quot;Interface Overview&quot;">​</a></h2><h3 id="_1-drag-drop-zone" tabindex="-1">1. Drag &amp; Drop Zone <a class="header-anchor" href="#_1-drag-drop-zone" aria-label="Permalink to &quot;1. Drag &amp; Drop Zone&quot;">​</a></h3><ul><li><strong>Location</strong>: Top of the view.</li><li><strong>Function</strong>: Drag any <code>.exe</code> or <code>.msi</code> file here to immediately start analysis.</li><li><strong>Supported Formats</strong>: Executables, MSI Packages, MSP Patches.</li></ul><h3 id="_2-analysis-results" tabindex="-1">2. Analysis Results <a class="header-anchor" href="#_2-analysis-results" aria-label="Permalink to &quot;2. Analysis Results&quot;">​</a></h3><p>Once a file is analyzed, the following sections appear:</p><ul><li><strong>Primary Info Table</strong>: Displays Product Name, Version, Manufacturer, and Installer Type.</li><li><strong>Silent Install Parameters</strong>: The discovered command-line arguments for silent installation (e.g., <code>/S</code>, <code>/VERYSILENT /SUPPRESSMSGBOXES</code>). <ul><li><em>Click the Copy icon to copy these to your clipboard.</em></li></ul></li><li><strong>Silent Uninstall Parameters</strong>: Arguments to remove the application silently.</li></ul><h3 id="_3-action-buttons" tabindex="-1">3. Action Buttons <a class="header-anchor" href="#_3-action-buttons" aria-label="Permalink to &quot;3. Action Buttons&quot;">​</a></h3><p>These buttons provide quick workflows based on the analysis:</p><ul><li><strong>Auto Deploy (All-in-One)</strong>: <ul><li>Generates a PowerShell script.</li><li>Packages it as <code>.intunewin</code>.</li><li>Uploads it to your configured Intune tenant (Settings required).</li></ul></li><li><strong>Test Locally (Admin)</strong>: <ul><li>Runs the installer <em>with the detected silent switches</em> on your local machine.</li><li><strong>Note</strong>: Requires Administrator privileges. You may be prompted to restart SwitchCraft as Admin.</li></ul></li><li><strong>Winget Manifest</strong>: <ul><li>Generates a preliminary Winget Manifest based on the analysis.</li><li>Useful for submitting packages to the Windows Package Manager repository.</li></ul></li></ul><h3 id="_4-advanced-tools" tabindex="-1">4. Advanced Tools <a class="header-anchor" href="#_4-advanced-tools" aria-label="Permalink to &quot;4. Advanced Tools&quot;">​</a></h3><ul><li><strong>Generate Intune Script</strong>: Creates a standardized <code>Install-App.ps1</code> wrapper script using your templates.</li><li><strong>Create .intunewin</strong>: Packages the installer and script into the format required by Microsoft Intune.</li><li><strong>Manual Commands</strong>: Shows the raw CMD and PowerShell commands if you need to run them manually in a terminal.</li><li><strong>View Detailed Analysis Data</strong>: Opens a raw log of the &quot;Brute Force&quot; and internal analysis logic. Use this if detection seems incorrect.</li></ul><h2 id="dependencies-requirements" tabindex="-1">Dependencies &amp; Requirements <a class="header-anchor" href="#dependencies-requirements" aria-label="Permalink to &quot;Dependencies &amp; Requirements&quot;">​</a></h2><ul><li><strong>Advanced Addon</strong>: Required for &quot;Universal Analysis&quot; and deep inspection of complex EXE files. <ul><li><em>If missing, a red warning banner will appear.</em></li></ul></li><li><strong>Internet Connection</strong>: Required for Winget lookups and Community Database checks.</li><li><strong>Admin Rights</strong>: Required for the &quot;Test Locally&quot; feature.</li></ul><h2 id="troubleshooting" tabindex="-1">Troubleshooting <a class="header-anchor" href="#troubleshooting" aria-label="Permalink to &quot;Troubleshooting&quot;">​</a></h2><ul><li><strong>&quot;Advanced Feature Required&quot;</strong>: Ensure you have installed the &quot;Advanced&quot; addon via <strong>Settings &gt; Help</strong>.</li><li><strong>&quot;Silent Installation Disabled&quot;</strong>: Some installers have anti-silent flags. The Analyzer will warn you if this is detected.</li><li><strong>Wrong Switches</strong>: If the detected switches don&#39;t work, try &quot;View Detailed Analysis Data&quot; to see alternative suggestions, or check the vendor&#39;s documentation.</li></ul>',20)])])}const p=t(o,[["render",r]]);export{g as __pageData,p as default};
